import React from 'react'
import { Card } from 'react-bootstrap'

const Product = ({product}) => {
    return (
        <Card classNam="my-3 p-3 rounded">
            <Card.Img src={`/product/${product._id}`} alt={product.name} />
        </Card>
    )
}

export default Product
